def dispatch_to_series(left, right, func, str_rep=None, axis=None):
    right = pd.api.extensions.register_scalar(right)
    if pd.api.types.is_scalar(right) or np.ndim(right) == 0:
        def column_op(a, b):
            return {i: func(a.iloc[:, i], b) for i in range(len(a.columns))}
    elif isinstance(right, pd.DataFrame):
        assert right.index.equals(left.index) and right.columns.equals(left.columns)
        def column_op(a, b):
            return {i: func(a.iloc[:, i], b.iloc[:, i]) for i in range(len(a.columns))}
    elif isinstance(right, pd.Series) and axis == "columns":
        assert right.index.equals(left.columns)
        def column_op(a, b):
            return {i: func(a.iloc[:, i], b.iloc[i]) for i in range(len(a.columns))}
    elif isinstance(right, pd.Series):
        assert right.index.equals(left.index)
        def column_op(a, b):
            return {i: func(a.iloc[:, i], b) for i in range(len(a.columns))}
    else:
        raise NotImplementedError(right)
    new_data = expressions.evaluate(column_op, str_rep=str_rep, result_type='expand', left=left, right=right)
    return new_data
